<h3 class="western">&Eacute;quipement en mat&eacute;riel informatique des espaces</h3>
<p class="western">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Pour ce qui est des ordinateurs et des outils d'impression, la M2L ne dispose que de ses propres &eacute;quipements, dans les bureaux d'administration du CROSL et dans la salle multim&eacute;dia. Les bureaux des ligues sont &eacute;quip&eacute;s par les ligues elles-m&ecirc;mes (hors mobilier de base). Des ressources d'impression mutualis&eacute;es payantes sont n&eacute;anmoins disponibles &agrave; l'administration de la M2L.</span></p>
<p class="western" align="justify">&nbsp;</p>
<h4 class="western"><a name="__RefHeading___Toc294250839"></a>Connectique fournie selon les espaces</h4>
<p class="western">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Chaque bureau de ligue du b&acirc;timent A dispose de deux prises Ethernet de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>5</em></span><span style="font-family: Calibri, sans-serif;"> et d'une prise t&eacute;l&eacute;phonique. Dans le nouveau b&acirc;timent C, ce sont trois prises Ethernet de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>6</em></span><span style="font-family: Calibri, sans-serif;"> qui sont disponibles dans chaque bureau pour connecter du mat&eacute;riel informatique ou un appareil de t&eacute;l&eacute;phonie IP.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Chaque salle de r&eacute;union dispose d'une prise Ethernet pour la connexion d'un PC portable au r&eacute;seau (de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>5</em></span><span style="font-family: Calibri, sans-serif;"> dans le b&acirc;timent B et </span><span style="font-family: Calibri, sans-serif;"><em>6</em></span><span style="font-family: Calibri, sans-serif;"> dans le b&acirc;timent D). Elle dispose en outre d'un syst&egrave;me fixe de vid&eacute;o projection, mais pas d'ordinateur &agrave; demeure.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">La salle de formation multim&eacute;dia dispose de 26 prises Ethernet de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>5</em></span><span style="font-family: Calibri, sans-serif;">, une pour chacun des 25 PC (24 PC "stagiaires" et un PC "formateur"), et la derni&egrave;re pour une imprimante r&eacute;seau.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">L'amphith&eacute;&acirc;tre dispose de 4 prises Ethernet de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>5</em></span><span style="font-family: Calibri, sans-serif;"> sur le pupitre. Il dispose &eacute;galement d'un syst&egrave;me de vid&eacute;o projection sur grand &eacute;cran. Une prise Ethernet est disponible &eacute;galement dans la r&eacute;gie.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Les bureaux d'administration de la M2L disposent en tout de 27 prises de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>6</em></span><span style="font-family: Calibri, sans-serif;">, pour les neuf bureaux. La salle de reprographie est dot&eacute;e de 4 prises Ethernet de cat&eacute;gorie </span><span style="font-family: Calibri, sans-serif;"><em>6</em></span><span style="font-family: Calibri, sans-serif;"> pour les syst&egrave;mes d&rsquo;impression num&eacute;riques connect&eacute;s.</span></p>
<h4 class="western">Implantation des &eacute;crans du r&eacute;seau d'affichage et des bornes Wifi</h4>
<p class="western">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Un syst&egrave;me de diffusion d'informations est install&eacute; sur 3 &eacute;crans 42" dans les espaces de circulation. Ils servent essentiellement &agrave; l'information des visiteurs sur les lieux de r&eacute;union. Les &eacute;crans d'information sont renseign&eacute;s depuis l'administration de la M2L.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Un r&eacute;seau Wifi gratuit est disponible pour les visiteurs dans les espaces de r&eacute;union du rez-de-chauss&eacute;e, mais &eacute;galement dans les &eacute;tages des bureaux des ligues (les bornes y sont positionn&eacute;es en quinconce d'un &eacute;tage &agrave; l'autre).</span></p>
