<h4 class="western"><a name="__RefHeading___Toc294250841"></a>Implantation des baies de brassage</h4>
<p class="western">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Il y a eu un laps de temps important entre la construction des b&acirc;timents A et B (construits au d&eacute;but des ann&eacute;es 90) et C et D (tout derni&egrave;rement construits, en 2010).</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Pour le b&acirc;timent A, on trouve une armoire de brassage secondaire pour chacun des 4 niveaux d'implantation des bureaux de ligues. Chacune de ces armoires regroupe 22 prises Ethernet : 20 vers les bureaux, une vers la borne Wifi et une vers la salle de r&eacute;union. On trouve un commutateur 26 ports dans chacune de ces armoires (24 ports 10/100 et deux ports Giga combo RJ-45 / SFP). Ces armoires de brassage sont connect&eacute;es &agrave; une armoire centralisatrice au rez-de-chauss&eacute;e, dans un petit local climatis&eacute; du b&acirc;timent B.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Pour le nouveau b&acirc;timent C, on a positionn&eacute; une seule armoire de brassage au niveau quasi central du second &eacute;tage du b&acirc;timent. Cette armoire r&eacute;unit 128 prises, 32 par &eacute;tage (3 par bureau, une prise pour la salle de r&eacute;union et une pour la borne wifi). On y trouve 4 commutateurs 48 ports, dont tous les ports sont utilisables en gigabits/s. Cette armoire est connect&eacute;e en fibre optique &agrave; l'armoire centralisatrice du b&acirc;timent B.</span></p>
<p class="western" align="justify">&nbsp;</p>
<p class="western" align="justify"><span style="font-family: Calibri, sans-serif;">Les salles du RDC des nouveaux b&acirc;timents C et D (salles &agrave; r&eacute;servations, bureaux d'administration de la M2L, la salle de reprographie) ainsi que les bornes Wifi et les 3 &eacute;crans d'information sont tous connect&eacute;s &agrave; l'armoire de brassage principale du b&acirc;timent B dans laquelle on trouve 2 commutateurs &agrave; 24 ports et un routeur. C'est &eacute;galement le lieu d'implantation de l'armoire &agrave; serveurs.</span></p>
